import React from "react";
import {
  ButtonBack,
  ButtonFirst,
  ButtonLast,
  ButtonNext,
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  DotGroup,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={100}
      naturalSlideHeight={125}
      totalSlides={3}
    >
      <Slider style={{ color: "red", backgroundColor: "yellow" }}>
        <Slide index={0}>
          <div
            style={{ width: "500px", height: "500px", backgroundColor: "red" }}
          ></div>
        </Slide>
        <Slide index={1}>
          <div
            style={{ width: "500px", height: "500px", backgroundColor: "red" }}
          ></div>
        </Slide>
        <Slide index={2}>
          <div
            style={{ width: "500px", height: "500px", backgroundColor: "red" }}
          ></div>
        </Slide>
      </Slider>
      <ButtonBack>Back</ButtonBack>
      <ButtonNext>Next</ButtonNext>
    </CarouselProvider>
  );
};

export default SlickCard;
